import React from 'react';
import './RetreatCard.css';

function RetreatCard ({ retreat }){
  return (
    <div className="retreat-card">
      <h4 style={{fontWeight:'bold'}}>{retreat.title}</h4>
      <p>{retreat.date}</p>
      <p>{retreat.location}</p>
      <p>{retreat.price}</p>
    </div>
  );
};

export default RetreatCard;
